import "../../App.css"; // Adjust the path if necessary
import "../../style/ArrangeWords.css";
import { Route, Router, Switch } from "react-router-dom";
import NavigationBar from "../../components/NavigationBar";
import NgaturUkaraNglegena from "../../components/isikuisnglegena/NgaturUkaraNglegena";
import UtakAtikGathukNglegena from "../../components/isikuisnglegena/UtakAtikGathukNglegena";
function IsiKuis2A() {
  return (
    <div>
      {/* navigation bar */}
      <div>
        <NavigationBar />
      </div>
      {/* end of intro section */}

      {/* mode */}
      <Router>
        <Switch>
          <Route
            path="/aksaranglegena/kuis1/ngaturukaranglegena"
            exact
            component={NgaturUkaraNglegena}
          />
          <Route
            path="/aksaranglegena/kuis1/utakatikgathuknglegena"
            component={UtakAtikGathukNglegena}
          />
        </Switch>
      </Router>
      {/* mode */}
    </div>
  );
}

export default IsiKuis2A;
